import { useContext, useEffect, useState } from "react";
import Header from "../../components/header/Header";
import Navbar from "../../components/navbar/Navbar";
import "./transaction.css"
import axios from "axios";
import { AppContext } from "../../context/AppContext";
const Transaction = () => {
    const [dataTran, setDateTran] = useState
    const {dataUser} = useContext(AppContext)
    
    useEffect(()=>{
       if(dataUser){
        axios.get(`http://localhost:5000/hotels/transaction/${dataUser.username}`)
        .then(response => {
            setDateTran(response.data)
        }).catch(err => {
            console.log(err)
        })
       }
    }, [dataUser])
  return (<div>
    <Navbar/>  
    <Header type={"list"}/>
    <div class="container">
         <h3>Your Transactions</h3>
        <table class="transaction-table">
            <thead>
                <tr>
                    <th>#</th>
                    <th>Hotel</th>
                    <th>Room</th>
                    <th>Date</th>
                    <th>Price</th>
                    <th>Payment Method</th>
                    <th>Status</th>
                </tr>
            </thead>
           
            <tbody>
            {dataTran && dataTran.map((item,index) => <tr>
                    <td>{index}</td>
                    <td>{item.hotel}</td>
                    <td>{item.room}</td>
                    <td>{item.date}</td>
                    <td>{item.price}</td>
                    <td>{item.payment}</td>
                    <td>{item.status}</td>
                    
                </tr>)}
                <tr>
                    <td>2</td>
                    <td>Hotel B</td>
                    <td>202</td>
                    <td>2024-08-28</td>
                    <td>Cash</td>
                    <td>Checkin</td>
                </tr>
             
            </tbody>
        </table>
    </div>
  </div>)   
}
export default Transaction;
